import React from 'react';
import Theme from './theme';
import codeclastLogo from '../../assets/img/codeclastfulllogo.png';

function Header({ currentContent, handleContentChange }) {
    //sends change page content request to useState in App.js, colors active button 
    const onClick = (e) => {
        handleContentChange(e.target.id);
        Set.e.target.className( currentContent === 'current' ? 'link' : 'link' )
    }

    //logo, theme and nav bar
    return (
        <header>
            <nav>
                <h1>
                    <img src={codeclastLogo} className="logo" alt="CODECLAST"></img>
                </h1>
                <Theme />
                <div className="navbox" onClick={(e) => onClick(e)}>
                    <h2 href="#about" id='about' className={currentContent === 'current' ? 'x' : 'link'}>/about</h2>
                    <h2 href="#portfolio" id='portfolio' className={currentContent === 'current' ? 'x' : 'link'}>/portfolio</h2>
                    <h2 href="#resume" id='resume' className={currentContent === 'current' ? 'x' : 'link'}>/resume</h2>
                    <h2 href="#contact" id='contact' className={currentContent === 'current' ? 'x' : 'link'}>/contact</h2>
                </div>
            </nav>
        </header>
    )
};

export default Header;
